import logo from './logo.svg';
import './App.css';
import React from 'react';
import home from './home';



const Product = (prods) => {
  return(
    <a className='product-container'>
      <img className = "product-image" src={prods.image}></img>
      <h1>{prods.name}</h1>
      <p>{prods.description}</p>
    </a>
  )
}

function App() {
  return (
    <div className="App">
      <home/>
    </div>
  );
}



export default App;
